  .tooltip-component__body, [data-tooltip]::after{

    max-width:32rem;
    opacity:0;
    overflow:hidden;
    padding:8px 16px;
    pointer-events:none;
    position:absolute;
    text-overflow:ellipsis;
    transform:translate(-50%, 0);

    white-space:nowrap;
    box-sizing:border-box;
    z-index:10;
